INSERT INTO public.labels_lbl (lbl_id, mig_id, lbl_name, lbl_description, lbl_color, created_at, updated_by, updated_at, created_by) VALUES
	(1, '7b989467-cabc-4c4f-9c69-d26a199a3c21', 'careo animus', 'Voluntarius abbas spes tremo patior cito trepide aer summisse.', '#482819', '2025-10-01 11:48:44.570467+00', 'system', '2025-10-01 11:48:44.570467+00', 'generator'),
	(2, '7b989467-cabc-4c4f-9c69-d26a199a3c21', 'ultra velut', 'Vere repellat adiuvo tutis molestias aedificium aiunt contabesco.', '#134c3d', '2025-10-01 11:48:44.571539+00', 'system', '2025-10-01 11:48:44.571539+00', 'generator'),
	(3, '7b989467-cabc-4c4f-9c69-d26a199a3c21', 'odit', 'Volaticus temeritas eius adfero colo pax utrum aggero ustulo.', '#522d01', '2025-10-01 11:48:44.572054+00', 'system', '2025-10-01 11:48:44.572054+00', 'generator'),
	(4, 'ff509dc7-cea0-4761-9ef4-db103236eb1c', 'subito abeo', 'Turba officiis ipsa tenax cimentarius defetiscor tristis bis uxor.', '#50015a', '2025-10-01 11:48:44.572614+00', 'system', '2025-10-01 11:48:44.572614+00', 'generator'),
	(5, 'ff509dc7-cea0-4761-9ef4-db103236eb1c', 'socius', 'Acsi volaticus verbera vulnus.', '#043b37', '2025-10-01 11:48:44.573112+00', 'system', '2025-10-01 11:48:44.573112+00', 'generator'),
	(6, 'ff509dc7-cea0-4761-9ef4-db103236eb1c', 'vapulus', 'Deprimo bellicus coma deporto usitas non depulso valde similique.', '#15012d', '2025-10-01 11:48:44.573529+00', 'system', '2025-10-01 11:48:44.573529+00', 'generator'),
	(7, '904c3fb0-a406-4fdf-87e7-3883ee510450', 'clibanus solutio cohors', 'Ustilo demoror numquam suasoria derelinquo.', '#1a2c2b', '2025-10-01 11:48:44.573926+00', 'system', '2025-10-01 11:48:44.573926+00', 'generator'),
	(8, '904c3fb0-a406-4fdf-87e7-3883ee510450', 'suasoria super', 'Damnatio tenax defleo eligendi volaticus.', '#353213', '2025-10-01 11:48:44.574301+00', 'system', '2025-10-01 11:48:44.574301+00', 'generator'),
	(9, '904c3fb0-a406-4fdf-87e7-3883ee510450', 'sperno facere eveniet', 'Suscipit conatus spiculum vulariter corrigo supra tergeo.', '#5f776e', '2025-10-01 11:48:44.574663+00', 'system', '2025-10-01 11:48:44.574663+00', 'generator'),
	(10, '904c3fb0-a406-4fdf-87e7-3883ee510450', 'rerum', 'Deputo arbustum demum terminatio vel.', '#62347d', '2025-10-01 11:48:44.575038+00', 'system', '2025-10-01 11:48:44.575038+00', 'generator'),
	(11, '904c3fb0-a406-4fdf-87e7-3883ee510450', 'terga', 'Tergum ulterius tepesco saepe exercitationem amplexus adfectus caecus.', '#3e2a27', '2025-10-01 11:48:44.575438+00', 'system', '2025-10-01 11:48:44.575438+00', 'generator'),
	(12, '61f75c5f-fb29-4376-910f-ed3515d2917a', 'veritas auctus', 'Verumtamen fugit templum venustas nihil vomica vinculum at venia termes.', '#78732e', '2025-10-01 11:48:44.575816+00', 'system', '2025-10-01 11:48:44.575816+00', 'generator'),
	(13, '61f75c5f-fb29-4376-910f-ed3515d2917a', 'creta virtus amicitia', 'Utrum doloremque tantillus balbus bonus triduana vobis tutis.', '#306b0a', '2025-10-01 11:48:44.576208+00', 'system', '2025-10-01 11:48:44.576208+00', 'generator'),
	(14, '61f75c5f-fb29-4376-910f-ed3515d2917a', 'acceptus cena', 'Harum labore textor conor recusandae conservo facilis.', '#547e5e', '2025-10-01 11:48:44.57659+00', 'system', '2025-10-01 11:48:44.57659+00', 'generator'),
	(15, '61f75c5f-fb29-4376-910f-ed3515d2917a', 'sulum sonitus urbanus', 'Derelinquo velit tego averto.', '#0e6429', '2025-10-01 11:48:44.576945+00', 'system', '2025-10-01 11:48:44.576945+00', 'generator'),
	(16, '61f75c5f-fb29-4376-910f-ed3515d2917a', 'aetas compono', 'Certe collum ultra summisse vulariter tersus vulnus vulpes optio aggredior.', '#565935', '2025-10-01 11:48:44.57755+00', 'system', '2025-10-01 11:48:44.57755+00', 'generator'),
	(17, '61f75c5f-fb29-4376-910f-ed3515d2917a', 'suggero', 'Corpus arceo eligendi usitas venio amaritudo quis.', '#522825', '2025-10-01 11:48:44.578061+00', 'system', '2025-10-01 11:48:44.578061+00', 'generator'),
	(18, '61f75c5f-fb29-4376-910f-ed3515d2917a', 'torqueo cernuus asperiores', 'Sapiente custodia approbo talio ventus.', '#4a342a', '2025-10-01 11:48:44.578515+00', 'system', '2025-10-01 11:48:44.578515+00', 'generator'),
	(19, '61f75c5f-fb29-4376-910f-ed3515d2917a', 'theologus bos', 'Adiuvo natus deleo supra crur.', '#7b035e', '2025-10-01 11:48:44.579137+00', 'system', '2025-10-01 11:48:44.579137+00', 'generator'),
	(20, '3bc680b2-3799-40fa-b558-a26a56a6e56f', 'carbo advenio verus', 'Vulgaris atqui adeo concedo voluptatem deduco sursum toties dignissimos.', '#6f5c0e', '2025-10-01 11:48:44.579742+00', 'system', '2025-10-01 11:48:44.579742+00', 'generator'),
	(21, '3bc680b2-3799-40fa-b558-a26a56a6e56f', 'alveus', 'Tutis considero vehemens.', '#202336', '2025-10-01 11:48:44.580218+00', 'system', '2025-10-01 11:48:44.580218+00', 'generator'),
	(22, '3bc680b2-3799-40fa-b558-a26a56a6e56f', 'et', 'Compello spiculum vae desparatus cras stillicidium.', '#203d08', '2025-10-01 11:48:44.580725+00', 'system', '2025-10-01 11:48:44.580725+00', 'generator'),
	(23, '3bc680b2-3799-40fa-b558-a26a56a6e56f', 'studio cenaculum defero', 'Vesco ciminatio cognomen earum benigne quis decerno.', '#713b6e', '2025-10-01 11:48:44.581245+00', 'system', '2025-10-01 11:48:44.581245+00', 'generator'),
	(24, '3bc680b2-3799-40fa-b558-a26a56a6e56f', 'speciosus inventore vomica', 'Aggero stillicidium tum ipsa vicissitudo labore adiuvo fuga decerno doloremque.', '#771836', '2025-10-01 11:48:44.5817+00', 'system', '2025-10-01 11:48:44.5817+00', 'generator'),
	(25, '3bc680b2-3799-40fa-b558-a26a56a6e56f', 'convoco ars utique', 'Curso abduco tactus esse spero cubicularis desipio averto.', '#2f5c48', '2025-10-01 11:48:44.582201+00', 'system', '2025-10-01 11:48:44.582201+00', 'generator'),
	(26, '3bc680b2-3799-40fa-b558-a26a56a6e56f', 'sopor', 'Urbanus aduro taceo terreo crudelis benevolentia.', '#2e7a22', '2025-10-01 11:48:44.582649+00', 'system', '2025-10-01 11:48:44.582649+00', 'generator'),
	(27, '3bc680b2-3799-40fa-b558-a26a56a6e56f', 'voco speculum ultio', 'Certus et acervus sustineo unus.', '#740c79', '2025-10-01 11:48:44.583145+00', 'system', '2025-10-01 11:48:44.583145+00', 'generator');
